general:
  name: asTrans
  short: 'migration: needs update'
  description: 'Astrometric transformations for every field in a single imaging run.  It

    transforms frame (row,col) coordinates to great circle (mu,nu) coordinates

    for a given inclination.'
  datatype: FIT
  filesize: 930 KB
  releases:
  - DR8
  - DR9
  - DR10
  - DR12
  - DR11
  - DR13
  - DR14
  - DR15
  - DR16
  - DR17
  environments:
  - PHOTO_REDUX
  naming_convention: 'asTrans-rrrrrr.fit, for those produced by ASTROM, <br/> scTrans-rrrrrr-c.fit,
    for those produced by SSC, <br/> where <i>rrrrrr</i> is the imaging run number
    and <i>c</i> is the camera

    column.'
  generated_by: astrom, ssc
changelog:
  description: Describes changes to the datamodel product and/or file structure from
    one release to another
  releases:
    DR17:
      from: DR16
      note: No changes
    DR16:
      from: DR15
      note: No changes
    DR15:
      from: DR14
      note: No changes
    DR14:
      from: DR13
      note: No changes
    DR13:
      from: DR11
      note: No changes
    DR11:
      from: DR12
      note: No changes
    DR12:
      from: DR10
      note: No changes
    DR10:
      from: DR9
      note: No changes
    DR9:
      from: DR8
      note: No changes
