  DR8:
    template: $PHOTO_REDUX/301/2335/astrom/asTrans-002335.fit
    example: 301/2335/astrom/asTrans-002335.fit
    location: 301/2335/astrom/asTrans-002335.fit
    environment: PHOTO_REDUX
    access:
      in_sdss_access: true
      path_name: asTrans
      path_template: $PHOTO_REDUX/{rerun}/{run}/astrom/asTrans-{run:0>6}.fit
      path_kwargs:
      - run
      - rerun
      - run
      access_string: asTrans = $PHOTO_REDUX/301/2335/astrom/asTrans-002335.fit
    hdus:
      hdu0:
        name: PRIMARY
        description: 'TRANS files produced by SSC have the "SSC_ID" keyword, identifying
          the SSC

          pipeline run which produced the file, but don''t have the "ASTRO_ID",

          "SSCXX_ID", or "PSXX_ID" keywords.  TRANS files produced by ASTROM have
          the

          "ASTRO_ID" keyword, identifying the ASTROM pipeline run which produced the

          file, but don''t have the "SSC_ID" keyword.  For ASTROM produced TRANS files,

          if the input FANG files came from SSC then there is an "SSCXX_ID" keyword

          for each camera column processed, identifying the SSC pipeline run which

          produced those FANG files, whereas if the FANG files came from PS then there

          is a "PSXX_ID" keyword for each column.'
        is_image: true
        size: 0 bytes
        header:
        - key: SIMPLE
          value: true
          comment: conforms to FITS standard
        - key: BITPIX
          value: 8
          comment: array data type
        - key: NAXIS
          value: 0
          comment: number of array dimensions
        - key: EXTEND
          value: true
          comment: ''
        - key: VERSION
          value: NOCVS:v3_8g
          comment: Version of software used.
        - key: KO_VER
          value: v1_9_2  :opCamera-50000.par
          comment: Version of known object catalog used.
        - key: ASTRO_ID
          value: 2009-05-24T09:59:32 10084
          comment: ASTROM pipe run id (ASTROM TRANS files only)
        - key: PS04_ID
          value: 2009-05-24T09:15:10 07222 camCol 4
          comment: PS pipeline run identifier for column 4.
        - key: PS05_ID
          value: 2009-05-24T09:14:20 21299 camCol 5
          comment: PS pipeline run identifier for column 5.
        - key: PS01_ID
          value: 2009-05-24T09:15:02 01909 camCol 1
          comment: PS pipeline run identifier for column 1.
        - key: PS06_ID
          value: 2009-05-24T09:38:53 32135 camCol 6
          comment: PS pipeline run identifier for column 6.
        - key: PS02_ID
          value: 2009-05-24T09:15:00 01851 camCol 2
          comment: PS pipeline run identifier for column 2.
        - key: PS03_ID
          value: 2009-05-24T09:15:13 07275 camCol 3
          comment: PS pipeline run identifier for column 3.
        - key: RUN
          value: 2335
          comment: Imaging run number.
        - key: INCL
          value: 64.997552
          comment: Great circle inclination wrt cel. eq. (degrees)
        - key: COMMENT
          value: 'mu nu are defined as:'
          comment: nu = d + e * rowm + f * colm
        - key: COMMENT
          value: mu = a + b*row + c*col
          comment: nu = d + e * rowm + f * colm
        - key: COMMENT
          value: nu = d + e*row + f*col
          comment: nu = d + e * rowm + f * colm
        - key: NODE
          value: 94.987719
          comment: RA of great circle's asending node. (degrees)
        - key: EQUINOX
          value: 2000.0
          comment: Equinox of great circle coordinates. (years)
        - key: FIELD0
          value: 11
          comment: First field reduced.
        - key: NFIELDS
          value: 142
          comment: Number of fields reduced.
        - key: CCDARRAY
          value: photo
          comment: CCD array (photo or astro)
        - key: CAMCOLS
          value: 1 2 3 4 5 6
          comment: Columns in the imaging camera processed.
        - key: FILTERS
          value: r i u z g
          comment: Filters (rows in the imaging camera) processed.
